openapi: 3.0.1
info:
  title: Transcriber.Core.API
  version: v1
paths:
  /api/Core:
    post:
      tags:
        - Core
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/NewAudioCommand'
            example:
              data: 
              email: no-reply-semantika@vdu.lt
              fileName: Pavasaris.mp3
              jobType: general
              numberOfSpeakers: 1
              recordQuality: standard
              isLithuanian: true
      responses:
        '200':
          description: Success
components:
  schemas:
    NewAudioCommand:
      type: object
      properties:
        data:
          type: string
          format: base64string
          description: Failo duomenys užkoduoti base64string formatu
        email:
          type: string
          description: El. paštas
        fileName:
          type: string
          description: Failo pavadinimas (galimi formatai - mp3, wav)
        jobType:
          type: string
          description: Sritis (galimos reikšmės - administration, general, law, medicine)
        numberOfSpeakers:
          type: integer
          format: int32
          nullable: true
          description: Diktorių skaičius (galimos reikšmės - null, 1, 2)
        recordQuality:
          type: string
          description: Įrašo kokybė (galimos reikšmės - standard, telephonic)
        isLithuanian:
          type: boolean
          description: Audio failas lietuvių kalba (galima reikšmė - true)
      additionalProperties: false
